import { createTheme } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#ffb5a7',
    },
    secondary: {
      main: '#b0c4b1',
    },
    background: {
      default: '#f7e1d7',
      paper: '#ffffff',
    },
    text: {
      primary: '#4a5759',
      secondary: '#4a5759',
    },
  },
});

export default theme;
